import React from 'react';
import products from './data';
import { Link } from 'react-router-dom';
import './style.css'

const Products = () => {
//  componentDidMount() {
  //  window.scrollTo(0, 0);
//}
  return (
    <>
    <section className="mywork-section" id='mywork'>
    <div className="work-column1">
    <h2 className="section-title">MYWORK</h2>
  </div>
      <div className='work-wrapper'>
        {products.map((product) => {
          return (
            <article key={product.id} className='project'>
              <div className='project-title1'>
                <Link to={`/products/${product.id}`} className='fonts'>{product.name}</Link>
              </div>
            </article>
          )
        }
        )}
      </div>
    </section>
    </>
  )
}
 export default Products;
